import React, { useState } from 'react';

const Services = () => {
  const [typeServiceF, settypeServiceF] = useState('');
  const [ageFilter, setAgeFilter] = useState('');
  const [languageFilter, setLanguageFilter] = useState('');

  const data = [
    { program: 'Computer', age: 20, language: 'English' },
    { program: 'Software', age: 21, language: 'Spanish' },
    { program: 'Electrical', age: 23, language: 'English' },
    { program: 'Languages', age: 20, language: 'French' },
    { program: 'Computer', age: 23, language: 'Spanish' },
    { program: 'Software', age: 21, language: 'English' }
  ];

  const handletypeServiceFChange = (e) => {
    settypeServiceF(e.target.value);
  };

  const handleAgeFilterChange = (e) => {
    setAgeFilter(e.target.value);
  };

  const handleLanguageFilterChange = (e) => {
    setLanguageFilter(e.target.value);
  };

  const filteredData = data.filter((item) => {
    if (typeServiceF && item.program !== typeServiceF) {
      return false;
    }
    if (ageFilter && item.age !== parseInt(ageFilter)) {
      return false;
    }
    if (languageFilter && item.language !== languageFilter) {
      return false;
    }
    return true;
  });

  return (
    <div>
      <div style={{ display: 'flex' }}>
        <div>
          <h2>Bachelors</h2>
          <div>
            <label>Program:</label>
            <select value={typeServiceF} onChange={handletypeServiceFChange}>
              <option value="">All</option>
              <option value="Computer">Computer</option>
              <option value="Software">Software</option>
              <option value="Electrical">Electrical</option>
              <option value="Languages">Languages</option>
            </select>
          </div>
          <div>
            <label>Age:</label>
            <select value={ageFilter} onChange={handleAgeFilterChange}>
              <option value="">All</option>
              <option value="20">20</option>
              <option value="21">21</option>
              <option value="23">23</option>
            </select>
          </div>
          <div>
            <label>Language:</label>
            <select value={languageFilter} onChange={handleLanguageFilterChange}>
              <option value="">All</option>
              <option value="English">English</option>
              <option value="Spanish">Spanish</option>
              <option value="French">French</option>
            </select>
          </div>
        </div>
        <div>
          <h3>Filtered Results:</h3>
          <ul>
            {filteredData.map((item, index) => (
              <li key={index}>
                Program: {item.program}, Age: {item.age}, Language: {item.language}
              </li>
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
};

export default Services;
